use employee;

drop table if exists salary_info;

CREATE TABLE `salary_info` (
  `emp_no` int NOT NULL,
  `emp_type` enum('W2','1099') NOT NULL,
  `pay_type` enum('Hourly','Salary') NOT NULL,
  `pay_freq` enum('Bi-weekly','Weekly') NOT NULL,
  `dol_status` enum('Full-Time','Part-Time') NOT NULL,
  `fed_tax`		float					NOT NULL,
  `med_tax`		float					NOT NULL,
  `soc_tax`		float					NOT NULL,
  `from_date` 	date NOT NULL,
  `to_date` 	date NOT NULL,
  PRIMARY KEY (`emp_no`,`from_date`),
  CONSTRAINT `salary_info_ibfk_1` FOREIGN KEY (`emp_no`) REFERENCES `employee` (`emp_no`) ON DELETE CASCADE
);


Select * From salary_info;